import React from 'react'
import "./movies.css"

function Movies() {
  return (
   <section className='movie-list' aria-label='upcoming movie'>
    <div className='title-wrapper'>
        <h3 className='title-large'>Upcoming Movies</h3>
    </div>
   </section>
  )
}

export default Movies
